import React from "react";
import "../BankingWelcomePage.css";
import welcomeimg from "../../image/welomeImage for bank.JPEG";
import { useNavigate } from "react-router-dom";

function WelcomePage() {
  const navigate = useNavigate();
  return (
    <div className="page-sizing">
      <img
        src={welcomeimg}
        alt="welcome-image"
        className="Welcome-Page-image"
      />
      <div className="content-container">
        <div className="login-btn-div">
          <button className="Welcome-Login" onClick={() => navigate("/login")}>
            Login
          </button>
        </div>
        <div className="register-welcome-details">
          <div className="Name-lable">
            <p>Easy Online Banking</p>
          </div>
          <div>
            <p className="details">
              Hit Register to Get Started with Digital Banking to Make Life Easy
            </p>
          </div>
          <div>
            <button
              className="Welcome-Register"
              onClick={() => navigate("/register")}
            >
              Register â†’
            </button>
          </div>
        </div>
      </div>
    </div>
  );
}

export default WelcomePage;
